// 2. FunciÃ³n para cambiar el contenido segÃºn la secciÃ³n
function cargarSeccion(nombreSeccion) {
    const contenedor = document.getElementById("contenido");
    const html = secciones[nombreSeccion] || secciones["inicio"];
    contenedor.innerHTML = html;
}

// 3. Configuramos el menÃº con un event listener
document.addEventListener("DOMContentLoaded", () => {
    const menu = document.getElementById("menu-lateral");

    // Cargamos por defecto la secciÃ³n "inicio"
    cargarSeccion("inicio");

    menu.addEventListener("click", (e) => {
        // Miramos si se ha clicado en un <a> con data-section
        const link = e.target.closest("a[data-section]");
        if (!link) return;

        e.preventDefault(); // evitamos que haga scroll al principio por el href="#"

        // Quitamos la clase active de todos
        menu.querySelectorAll("a").forEach((a) => {
            a.classList.remove("active");
            a.removeAttribute("aria-current");
        });

        // Marcamos como active el que se ha clicado
        link.classList.add("active");
        link.setAttribute("aria-current", "true");

        // Cargamos la secciÃ³n correspondiente
        const seccion = link.dataset.section; // ej: "pol01"
        cargarSeccion(seccion);
    });
});
